import './App.css';
import axios from "axios";

const baseURL = "http://localhost:3000/";

function App() {

  var returned;
  axios.get(baseURL).then((response) => {
          console.log(JSON.stringify(response));
          returned  = response.data;
      });


  return (
    <div className="App">
      <header className="App-header">
        <button>Get Title</button>
        {returned}
      </header>

    </div>
  );
}

export default App;
